// small wrapper to expose openSrc and auto-open via ?src= URL
const __initViewerInstance = ()=>{
  const inst = new bv();
  window.__dwgViewerInstance = inst;
  window.dwgViewer = {
    openSrc: async (srcUrl) => {
      try{
        if(!window.__dwgViewerInstance) throw new Error('Viewer not initialized');
        const parsed = new URL(srcUrl, window.location.href);
        if(parsed.protocol !== 'blob:' && parsed.origin !== window.location.origin) throw new Error('Cross-origin sources are not allowed');
        window.__dwgViewerInstance.clearMessages();
        window.__dwgViewerInstance.hideNewButton();
        const res = await fetch(srcUrl);
        if(!res.ok) throw new Error('Fetch failed: HTTP ' + res.status);
        const ab = await res.arrayBuffer();
        const name = decodeURIComponent((parsed.pathname.split('/').pop()) || 'drawing.dwg');
        await window.__dwgViewerInstance.loadArrayBuffer(name, ab);
      }catch(err){ console.error('openSrc error', err); if(window.__dwgViewerInstance){ window.__dwgViewerInstance.showMessage('Failed to open src: ' + (err.message||err),'error'); } }
    }
  };
  return inst;
};

if(document.readyState==="loading"){
  document.addEventListener("DOMContentLoaded",()=>{ const inst=__initViewerInstance();
    const qs = new URLSearchParams(window.location.search);
    const src = qs.get('src');
    if(src){ try{ window.dwgViewer.openSrc(src); }catch(e){console.warn('failed auto-open src',e);} }
  });
}else{ const inst=__initViewerInstance(); const qs=new URLSearchParams(window.location.search); const src=qs.get('src'); if(src){ try{ window.dwgViewer.openSrc(src);}catch(e){console.warn('failed auto-open src',e);} } }

